INSERT INTO `fat_patente` (`id_user`, `id_tempo`, `titulo`, `categoria`, `instituicao`, `descricao`) VALUES
(41476511097254, 27, 'PRÓTESE COM SISTEMA SENSORIAL', 'Produto', '', 'PRÓTESE COM SISTEMA SENSORIAL. A presente Datente diz respeito a prótese que contempla as 5 sensações somestésicas exteroceotivas (frio, quente, tato, força e dor), porém ainda contempla as variantes, vibração e pressão, podendo ser acrescido a qualquer prótese, inólusive de membro inferior, na sua totalidade ou de forma parcial, cujo Sistema utliza sensores de força (1), sensores de temperatura (2), circuito microprocessado (3), atuador elétrico (eletrodos de superfície,) e atuador vibratório (4) (motor elétrico que aciona massa excêntrica), sendo as sensações comandadas por um software embarcado.'),
(41476511097254, 28, 'KIT de Motorização para Cadeira de Rodas', 'Produto', '', NULL),
(41476511097254, 29, 'Kit de motorização para cadeira de rodas', 'Produto', '', NULL),
(477788198290554, 1109, 'FERRAMENTA DE CORTE E PROCESSO DE FORMAÇÃO DESTA.', 'Produto e Processo', '', '&quot;FERRAMENTA DE CORTE E PROCESSO DE FORMAÇÃO DESTA&quot;. Compreendendo um corpo básico (1) apresentando uma porção extrema ativa (2) revestida por um filme de diamante obtido pela técnica de crescimento de CVD, compreendendo acidentes superficiais (10) arranjados e dimensionados de modo a produzirem um substancial aumento da área de assentamento do filme de diamante e um aumentado grau de interferência mecânica com esse último. Esta patente refere-se à ferramenta acima e ao processo de obtenção desta para uso em corte, furação, abrasão e desgaste em geral, particularmente para serem acopladas em sistemas de ultra-som.'),
(477788198290554, 1110, 'Ferramenta de Corte e Processo de Formação Desta', '', 'Fapesp', NULL),
(530746850858281, 1438, 'Processo de Fabricação de Materiais compósitos de matriz metálica com reforços particulados e produtos assim obtidos.', 'Produto e Processo', '', 'A presente invenção refere-se a um processo de produção de compósitos de matriz metálica a partir de liga metálica no estado sólido, podendo esta estar sob as formas de placa, lingotes, tarugos ou cavacos, porém não se restringindo a essas, e de partículas de reforço maciças ou porosas. O produto resultante é um material compósito homogêneo, que apresenta propriedades diferenciadas em relação aos materiais individuais empregados. Além disso, o processo em si apresenta uma redução de custo e de gasto energético por economia da etapa de mistura da liga com o material de reforço e empregar reduzidas temperaturas de processo. O processo também reduz ou elimina pós-operações de conformação por produzir compósitos de matriz metálica reproduzindo, com fidelidade, a geometria do molde. Os compósitos metálicos obtidos por esse processo podem ser utilizados para aplicações que necessitem de materiais metálicos com propriedades diferenciadas, tais como na indústria automobilística, aeronáutica e outros setores da engenharia.'),
(580997618984789, 1529, 'Equipamento implantável de suporte temporário à vida de pacientes em espera para o transplante cardíaco.', 'Produto', '', 'Equipamento Implantável de Suporte Temporário à vida de pacientes em espera para o transplante cardíaco, composto por atuador eletromecânico implantável, por acoplamento magnético e por bomba centrífuga implantável de tamanho reduzido. Bomba caracterizada por mancais de apoio de baixo atrito para alta durabilidade e rotor com desenho de aletas e espirais.'),
(1436760007278366, 2998, 'Processo de produção de hexanoato de etila por via biotecnologica utilizando meio sintético e resíduos agroindustriais e seu uso', 'Processo', '', NULL),
(2917208722028226, 6106, 'PRODUÇÃO BIOTECNOLÓGICA DE XILITOL A PARTIR DO BAGAÇO DE  CANA-DE-AÇÚCAR ORGÂNICO', '', 'Desthil - SP', 'Data da publicação: 10/05/2011'),
(3055017593899202, 6673, 'Algômetro Vestível Flexível ou Soft wearable algometer', 'Produto', 'Instituto Federal de Educação, Ciência e Tecnologia de São Paulo, Universidade de São Paulo', 'Trata-se de dispositivo de monitoramento dos níveis de dor através da medição de pressão exercida na pele utilizando o princípio da variação da densidade de fluxo magnético em um sensor de Efeito Hall. Revela um dispositivo flexível e vestível, tipo dedal, para estudo dos níveis de dor, que compreende sistema de medição baseado em Sensor de Efeito Hall e ímã permanente embutidos na extremidade, de forma que o usuário, através do toque do dispositivo sobre a região dolorida, exerça uma pressão que resultará na aproximação do ímã em direção ao sensor. Este movimento se traduzirá em uma variação da densidade de fluxo magnético gerando uma tensão relacionada à distância entre os dois componentes. Essa informação será transmitida sem fio (wireless) por um microcontrolador responsável por analisar e tratar os dados recebidos. Os sistemas responsáveis pela recepção dos sinais do microcontrolador possuem programas que possibilitam a análise e o registro das medições efetuadas, de forma a permitir o estudo dos níveis de dor.'),
(3055017593899202, 6674, 'SOFT IONIC SENSORS AND METHOD OF MAKING', 'Produto', 'Harvard University', 'Esta invenção é dedicada a um sensor mole que pode lidar com alterações em seu comprimento de 250% ou mais. O sensor pode ser produzido na forma de uma microfibra que permite seu uso em uma larga faixa de aplicações, incluindo tecidos, pele artificial e outros materiais moles ou flexíveis.'),
(3522425475777833, 7962, 'Homo sapiens menin variant (MEN1) gene, exon 2 and partial cds.', 'Produto', '', NULL),
(4314966200727513, 9751, 'Aperfeiçoamentos introduzidos em aparelho de higienização bucal através de irrigação oral', '', '', 'Número de protocolo: 018060093986'),
(4314966200727513, 9752, 'Método de Varredura de Frequência para Estimulação de Sudorese', 'Produto e Processo', '', NULL),
(4314966200727513, 9753, 'Dispositivo auxiliar para calibração de bombas de rolete; método de calibração utilizando o referido dispositivo e uso do mesmo', '', '', 'Número de protocolo: 018100039108'),
(4893973422111886, 10669, 'Utilização das fibras de nylon provenientes da moagem de pneus inservíveis por meio de sua aglomeração com resina poliuretana e seu processo de produção', '', 'USP', 'Pesquisa com material compósito proveniente da associação de partículas de borracha retiradas de pneus inservíveis moídos aglomerados resina poliuretana.'),
(4893973422111886, 10670, 'Reutilização da borracha proveniente da moagem de pneus inservíveis por meio de sua aglomeração com resina poliuretanica de origem vegetal e seu processo de produção', '', 'USP', 'Pesquisa com material compósito proveniente da associação de partículas de borracha retiradas de pneus inservíveis moídos aglomerados resina poliuretana de origem vegetal.'),
(5971351057949885, 13288, 'Method, system and software arrangement for processing a device support file for a field device', 'Processo', 'Smar Research Corporation ; EndressProcess Solutions AG', 'A method, system computer-readable medium and software arrangement are provided for processing a device support file for a field device, such as a Foundation.TM. Fieldbus device. A device support file can be installed on a processing arrangement. The device support file may be received, for example, from a remote computer system. In one exemplary embodiment, a configuration file may be opened and reviewed to identify any missing device support files, and the missing files may be obtained automatically from the remote computer system. Upon the installation, a capabilities file of the device support file may be validated by comparing the capabilities file with common (previously obtained) rules generally associated with the capabilities file. In one further exemplary embodiment, the capabilities file may be validated by performing a consistency check of the retrieved capabilities file with a current version of the common rules.'),
(5971351057949885, 13289, 'Arrangements, storage mediums and methods for associating an extensible stylesheet language device description file with a non- proprietary language device description file', 'Processo', 'SMAR RESEARCH CORPORATION', 'An arrangement, storage medium and method are provided to associate an Extensible Stylesheet Language ("XSL") Device Description file with a non-proprietary language Device Description file. Each of the non-proprietary language Device Description file and the XSL Device Description file is associated with a particular type of a field device, and the XSL Device Description file includes a script-type language source code. For example, the non-proprietary language Device Description file can be an Extensible Markup Language Device Description file, and the script-type language source code can include a code associated with a method of implementing the field device and/or a function performed by the field device. Moreover, the non-proprietary language Device Description file and the XSL Device Description file can be converted into a platform-independent page having the script-type language source code embedded therein.\nUS Patent App. 10/436,956'),
(5971351057949885, 13290, 'System and method for providing information in a particular format', 'Produto e Processo', 'Smar Research Corporation', 'A system for providing information for a process, and a method to utilize such system are provided. In particular, a controller is communicatively coupled to at least one smart field device using an open smart communications protocol, and a server is communicatively coupled to the controller. The server is adapted to receive data associated with the smart field device from the controller. The server may transmit the data in a HTML format, or an at least one image which was generated based on the data. For example, the system further may include a computer system, and the server may transmit the data or the image of the data to such computer system. The computer system may also display the data in the HTML format, and/or the image of the data.\nUS Patent 6,631,298'),
(7586240232439023, 15780, 'MÉTODO DE DIMENSIONAMENTO DOS MEIOS DE FIXAÇÃO DE ESTRUTURAS MECÂNICAS SUBMETIDAS A ABALOS SÍSMICOS', 'Outra', '', 'MÉTODO DE DIMENSIONAMENTO DOS MEIOS DE FIXAÇÃO DE ESTRUTURAS MECÂNICAS SUBMETIDAS A ABALOS SÍSMICOS a partir das características do sistema, a saber, o valor da massa total e a localização do centro de massa, bem como das características do abalo sísmico, compreendendo o cálculo dos valores dos esforços solicitantes horizontais e verticais em função de ditas características e determinação das componentes horizontais e verticais das forças de reação nos elementos de fixação com base nos módulos e ângulos das forças de reação nos referidos elementos. O método apresenta como inovações principais à adoção de um abalo sísmico harmônico com uma componente horizontal e outra vertical, o estabelecimento das equações de equilíbrio translacional e rotacional e a verificação gráfica da estabilidade do sistema.'),
(8337771861251036, 17281, 'PROCESSO DE OBTENÇÃO DE EXTRATOS DE CASEARIA SYLVESTRIS, PROCESSOS DE OBTENÇÃO DE FRAÇÕES ATIVAS, EXTRATOS, FRAÇÕES ATIVAS, USO DE EXTRATOS E FRAÇÕES ATIVAS, COMPOSIÇÃO, UNIDADE DE DOSAGEM, MÉTODO PARA PREVENIR, TRATAR, COMBATER OU SUSPENDER DISTÚRBIOS GASTRINTESTINAIS, MEDICAMENTO E PRINCÍPIO ATIVO.', '', 'Fapesp/Unesp', ''),
(8337771861251036, 17282, 'EXTRATOS, FRAÇÕES ATIVAS E/OU COMPOSTOS ISOLADOS DE CASEARIA SYLVESTRIS, FORMULAÇÕES FARMACÊUTICAS E SEUS USOS', '', '', ''),
(8697221494886208, 17688, 'FÓRMULA PARA CASTRAÇÃO QUÍMICA', 'Produto', '', NULL),
(9165723122297620, 18210, 'SCANNER RESSONANTE PLANAR COM ATUAÇÃO INDUTIVA FORTEMENTE ACOPLADA', 'Produto', '', 'SCANNER RESSONANTE PLANAR COM ATUAÇÃO INDUTIVA FORTEMENTE ACOPLADA. O objeto da presente invenção compreende uma base plana de material com boas propriedades mecânicas que é suspensa por barras de torção (2) ancoradas em um quadro (4) do mesmo material, e que formam uma única peça. Esta base possui um espelho (3), para reflexão do feixe luminoso e uma perfuração (1), que delimita uma espira condutiva e que é atravessada por um circuito ferromagnético (7). O conjunto formado pelo espelho (3) e espira recebe o nome de rotor (1) ou armadura (9) e é movimentado por meio de forças eletromagnéticas de Lorentz. Tais forças são geradas pela interação entre uma corrente elétrica induzida na espira por um campo magnético alternado que percorre o circuito ferromagnético e um campo magnético continuo e paralelo à espira, gerado por um conjunto de ímãs fixos (8). O circuito ferromagnético (7) confina o fluxo magnético de excitação e faz com que a maior parte desse fluxo passe pela espira do rotor (1), maximizando a corrente induzida, o que é chamado aqui de acoplamento forte. A contraposição entre o torque induzido na bobina (6) e o torque restaurador, devido à força de mola das barras de torção (2), produz o movimento oscilante do rotor (1). Excitando-se o dispositivo em sua freqúência de ressonância mecânica, tem-se a máxima amplitude de deflexão do rotor (1). O movimento oscilante do espelho (3) é utilizado para posicionamento preciso e repetitivo de um feixe laser em um anteparo que pode ser: uma amostra biológica, um conjunto de lentes, a retina humana, uma superfície foto-sensível, um padrão impresso de barras, ou qualquer outro de acordo com a aplicação. Dentre as aplicações que utilizam a movimentação precisa de um feixe luminoso colimado, podem ser destacadas algumas que já utilizam scanners similares a este invento, tais como: alguns tipos de leitores de código de barras, microscópios confocais, displays retinais (que projetam imagens na retina humana), projetores de i'),
(9195827067481746, 18259, 'Composições Melhoradas de Massas Refratárias á Base de Sílica', 'Produto e Processo', 'Fapesp', NULL);
